import React from "react";
import { Link } from "react-router-dom";
import Layout from "../../components/Layout/Layout";
import TableFournisseur from "../../components/TableFournisseur/TableFournisseur";

function dashbord() {
  return (
    <div>
      <Layout>
        <div className="flex flex-col justify-center items-center text-xl gap-5 my-20">
          <li>
            <Link to="/fournisseur">fournisseur</Link>
          </li>
          <li>
            <Link to="/ressource">ressource</Link>
          </li>
          <li>
            <Link to="/materiaux">materiaux</Link>
          </li>
        </div>
      </Layout>

      <TableFournisseur />
    </div>
  );
}

export default dashbord;
